import React from "react";

function List({people}){
  people.map()
  const {name, age, image, id} = person;
  <article className="person">
    <img src={image} alt="" />
    <div>
      <h4>{name}</h4>
      <p>{age}</p>
    </div>
  </article>
}

export default List;
